script: |
  super -f text -I q11551.spq | sort > q11551.out

inputs:
  - name: q11551.spq
    data: |
      SELECT DISTINCT col1 - + col0 * + tab0.col2 AS col1 FROM tab0 (FORMAT parquet) WHERE col1 * - col1 - - col2 NOT BETWEEN ( NULL ) AND NULL;
  - name: tab0

outputs:
  - name: q11551.out
    data: |
